import React from 'react';

const Header = () => {
	return (
		<nav class='navbar navbar-dark bg-dark'>
			<a class='navbar-brand'>Streams</a>
			<div class='form-inline'>
				<button class='btn btn-outline-success my-2 my-sm-0' type='submit'>
					Search
				</button>
			</div>
		</nav>
	);
};

export default Header;
